import React from 'react';
import styled from 'styled-components';

const Mail = () => {
    return (
        <Style>
            <h2>Mail Sent!</h2>
            <p className="help-text">Please check your spam incase you don't find it.</p>
        </Style>
    );
}

export default Mail;

const Style = styled.div`
    background: #121e33;
    min-height: 100vh;
`
